const int times = 1;

std::vector<Ciphertext> infer(const Ciphertext &ctxt, const std::vector<Plaintext> vec_plt,
                 std::shared_ptr<EvaluatorCkksBase> eva, const GaloisKeys galois_key) {
    std::vector<Ciphertext> vec_res;
    for (auto plt : vec_plt)
    {
        poseidon::Ciphertext ctxt_result;
        eva->multiply_plain(ctxt, plt, ctxt_result);
        eva->rescale(ctxt_result, ctxt_result);

        poseidon::Ciphertext ctxt_rotate;
        for (auto j = 1; j < 1024; j <<= 1) {
            eva->rotate(ctxt_result, ctxt_rotate, j, galois_key);
            eva->add(ctxt_result, ctxt_rotate, ctxt_result);
        }

        vec_res.push_back(ctxt_result);
    }

    return vec_res;
}

